import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>나의 첫 번째 React 프로젝트</h1>
        <p>React로 재미있게 코딩해보자!</p>
      </header>
    </div>
  );
}

export default App;
